description:
siêu phẩm mới kính kong - full nội thất- ngõ 3m ba gác đua - vài bước ra phố _ 5tầng – 30,5m2 – 8,35 tỷ 
+ mô tả:
- vị trí vip trung tâm phường cầu giấy, ngõ cực thoáng sáng, gần phố, gần chợ, tiện ích xung quanh không thiếu gì;
- xung quanh là nhiều trường đại học lớn như đh thủ đô, đh quốc gia, sư phạm 1, đh gtvt, hv báo chí, hv ngoại giao, đh ngoại thương,...;
+ nhà thiết kế 5 tầng, khung btct (mặt tiền: 5m)
- tầng 1: phòng khách + để xe;
- tầng 2: 1 ngủ master + wc khép kín;
- tầng 3 : phòng khách bếp, phòng ăn;
- tầng 4: 2 ngủ + wc;
- tầng 5: phòng thờ và sân phơi.
nhà xây mới, cđt xây chất lượng, các phòng đều tràn ngập ánh sáng, full đầy đủ nội thất.
giá: 8,35tỷ
 sổ đỏ vuông vắn chính chủ, cất két sẵn sàng giao dịch.
